import {Link} from "react-router-dom"

const Navbar=()=>{
    return(
        <div className="nav relative "> 
        
        <Link to="/">
             <header className="absolute inset-y-0 left-0 bg-black w-46 " style={{height:"100vw" }}>
                    <h1>sdsdd</h1>
             </header>
        </Link>

        </div>
    )
}

export default Navbar;
